package server.util.easy_server.exception.client_manager;

public class StoppingClientManagingFailedException extends ClientManagerException {

	public StoppingClientManagingFailedException() {
		// TODO Auto-generated constructor stub
	}

	public StoppingClientManagingFailedException(String message) {
		super(message);
	}

	public StoppingClientManagingFailedException(Throwable cause) {
		super(cause);
	}

	public StoppingClientManagingFailedException(String message, Throwable cause) {
		super(message, cause);
	}

	public StoppingClientManagingFailedException(String message, Throwable cause, boolean enableSuppression,
			boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);
	}

}
